import logo from './logo.svg';
import './App.css';
import List from './components/list';
import Home from './components/home';
import About from './components/about';
import Nav from './components/nav';
import './bootstrap.css'
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Ditailes from './components/ditailes';
import Login from './components/login';

function App() {
  return (
    <div>

      <h1> שלום לכולם </h1>
      {/* BrowserRouter-תגית שבתוכה יוכלו הקומפוננטות המתחלפות */}
      <BrowserRouter>

        <Routes>
<Route path='/' element={<Login/>}></Route>
          {/* Routes-תגית המכילה את כל תגיות הניתובים */}
          {/* <Route path="/שם שאני רוצה" element={שם הקומפוננטה}></Route> */}
          <Route path='/mynav' element={<Nav></Nav>}></Route>
          <Route path="/myabout" element={<About/>}></Route>
          <Route path="myhome" element={<Home></Home>}></Route>
          <Route path="/mylist" element={<List/>}>
            {/* הגדת ניתוב לילדים ללא / */}
                 <Route path='myditailes/:myage/:mypic' element={<Ditailes></Ditailes>}></Route>
          </Route>
        </Routes>
      </BrowserRouter>

    </div>

  );
}

export default App;
